import React from "react";
import "../../assets/css/login.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faAddressBook } from "@fortawesome/free-solid-svg-icons";

const Login = () => {
  return (
    <div>
      <div>
        <p>Login</p>
      </div>
    </div>
  );
};

export default Login;
